 Pakistan by the Chief of RAW Ashwini Rao         
 to report the activities of The Most Wanted      
 Man in India. 9 days ago Rudra Pratap Singh      
 Indian Armed Forces, MARCOS unit, Zoya Rehman    
 RAW Explosives expert, and Aslam, a petty        
 thief from the streets of Mumbai recruited       
 by RAW, infiltrated Pakistan to join Wali        
 Khan and carry out the mission to bring back     
 The Most Wanted Man in India. The man who was    
 going to break all ISI protocol and security     
 and attend his own son's wedding. The man who    
